struct NodeWithColor{
  unsigned node;
  SumEdge color;
};



struct Matrix1{
  unordered_map<unsigned, char> colors;



};




class CFLMatrix{
 public:

 CFLMatrix(unsigned a) : Size(a),invec(a),outvec(a){  
    
    for(vector< vector<NodeWithColor>* >::iterator iter= invec.begin(); iter!= invec.end(); iter++){
      *iter = new vector<NodeWithColor>;
    }
    
    for(vector< vector<NodeWithColor>* >::iterator iter = outvec.begin(); iter!=outvec.end(); iter++){
      *iter = new vector<NodeWithColor>;
    }


  }//a*a}
  ~CFLMatrix(){ 
    for(vector< vector<NodeWithColor>* >::iterator iter= invec.begin(); iter!= invec.end(); iter++){
      delete *iter;
    }
    
    for(vector< vector<NodeWithColor>* >::iterator iter = outvec.begin(); iter!=outvec.end(); iter++){
      delete *iter;
    }

  }
  
  void InsertEdge(unsigned u, unsigned v, SumEdge x){
    NodeWithColor X;
    X.node =v;
    X.color = x;

    // make sure all nodes are good
    if(u>=Size || v>=Size){
	cout<<"[error]node: node out of range"<<endl;
	exit(0);
    }
    
    // we make sure what we will not insert duplicated edges;
    for(vector<NodeWithColor>::iterator iter = outvec[u]->begin(); iter!=outvec[u]->end(); iter++){
      if(iter->node==v && iter->color.l==x.l && iter->color.r == x.r){
	//cout<<"[error]duplicated edge: node "<<u<<" "<<v<<" with color "<<x<<endl;
	//exit(0);
	return;
      }
    }



    outvec[u]->push_back(X);
    X.node = u;
    invec[v]->push_back(X);
  }

  vector<NodeWithColor>* RetOutvec(unsigned u){return outvec[u];}
  vector<NodeWithColor>* RetInvec(unsigned u){return invec[u];}

 private:
  unsigned Size;  
  vector< vector<NodeWithColor>* > invec;
  vector< vector<NodeWithColor>* > outvec;
  

};


